    {name :"apple" ,price: 10},
    {name :"pineapple" , price: 2}
    ];
    return(
        <h1>
            {fruit.map(value => <h2 key={value.name}><EachFruit name = {value.name}  price = {value.price}/> </h2>)}
        </h1>
    );
}
